import React from "react";
import { Typography, CardMedia, Grid } from "@mui/material";
import SampleImage1 from "../assets/advertisement/sample1.jpg";
function Advertisement() {
  const adList = [
    {
      image: SampleImage1,
    },
    {
      image: SampleImage1,
    },
    {
      image: SampleImage1,
    },
    {
      image: SampleImage1,
    },
  ];
  return (
    <div id="item_9" className="Advertisement" style={{ height: "100vh" }}>
      <Grid container flexDirection={"column"} alignItems="center" spacing={4}>
        <Grid item xs={6}>
          <Typography variant="h4" style={{ textAlign: "center" }}>
            広告
          </Typography>
        </Grid>
        {[6].map((index) => (
          <Grid item xs={3} key={index}>
            <CardMedia component="img" image={SampleImage1} title={"広告"} />
          </Grid>
        ))}
      </Grid>
    </div>
  );
}

export default Advertisement;
